import Loader from 'react-loaders';
import './index.scss';
import AnimatedLetters from '../AnimatedLetters';
import { useEffect, useState } from 'react';

const Projects = () => {

    const title = "Projects."
    const titleArray = Array.from({length: title.length}, (_, i) => title[i])

    const [letterClass, setLetterClass] = useState('text-animate')

    useEffect(() => {
        setTimeout(() => {
            setLetterClass('text-animate-hover')
        }, 3000)
    }, [])

    return (
        <>
        <div className='container projects-page'>
            <div className='text-zone'>
                <h1>
                    <AnimatedLetters letterClass={letterClass} strArray={titleArray} idx={15} />
                </h1>
                <p>
                    This is a compilation of some projects I have worked on. They come from both academic projects at Binghamton University and personal endevors. I plan on continuously expanding this list as I master more skills. 
                </p>

            </div>
            <div className='word-image'>
                <img src='wordCollage.png' alt='Word Collage' width='100' height='400'/>
            </div>
        </div>
        <Loader type='line-scale' />
        </>
    )
}

export default Projects
